def truncate_after_substring(input_string, substring):
    # Truncates the input string after the first occurrence of the given substring.
        # (*) param input_string: 
        #    The string to be truncated.
        # (*) param substring:    
        #    The substring after which the string will be truncated.
        # (*) return:             
        #    Truncated string or the original string if the substring is not found.
    index = input_string.find(substring)
    if (index != -1):
        return input_string[:index]
    else:
        return input_string

def Convert_All_Kinematic_Bins(Start_Bins_Name, End_Bins_Name):
    Check_Name = f"{Start_Bins_Name} -> {End_Bins_Name}"
    Check_Name = Check_Name.replace("3D_Bins", "MultiDim_z_pT_phi_h")
    Check_Name = Check_Name.replace("5D_Bins", "MultiDim_Q2_y_z_pT_phi_h")
    if(Check_Name in Convert_MultiDim_Kinematic_Bins):
        return Convert_MultiDim_Kinematic_Bins[Check_Name]
    else:
        return "ERROR"

def FindCanvas_cd_Kinematic_Bins(Bin_Name="", Q2_y_Bin_Input=False, z_pT_Bin_Input=False):
    try:
        if(Q2_y_Bin_Input and z_pT_Bin_Input):
            Q2_y_Bin, z_pT_Bin = Q2_y_Bin_Input, z_pT_Bin_Input
        else:
            Q2_y_Bin, z_pT_Bin = "Error", "Error"
            if(any(check   in str(Bin_Name) for check in ["3D_Bins", "MultiDim_z_pT_phi_h"])):
                Q2_y_Bin = int(str(truncate_after_substring(Bin_Name, ",")).replace("Q2-y=", ""))
                z_pT_Bin = Convert_All_Kinematic_Bins(Bin_Name, "z-pT")
            elif(any(check in str(Bin_Name) for check in ["5D_Bins", "MultiDim_Q2_y_z_pT_phi_h"])):
                Q2_y_Bin = Convert_All_Kinematic_Bins(Bin_Name, "Q2-y")
                z_pT_Bin = Convert_All_Kinematic_Bins(Bin_Name, "z-pT")
            else:
                Q2_y_Bin = int(str(truncate_after_substring(Bin_Name,    ",")).replace("Q2-y=", ""))
                z_pT_Bin = int(str(Bin_Name.replace(f"Q2-y={Q2_y_Bin}, ", "")).replace("z-pT=", ""))
        if(f"Q2-y={Q2_y_Bin}, z-pT={z_pT_Bin}" not in FindCanvas_cd_of_Kinematic_Bins):
            return 0
        else:
            return FindCanvas_cd_of_Kinematic_Bins[f"Q2-y={Q2_y_Bin}, z-pT={z_pT_Bin}"]
    except:
        print(f"ERROR with 'FindCanvas_cd_Kinematic_Bins(Bin_Name={Bin_Name}, Q2_y_Bin_Input={Q2_y_Bin_Input}, z_pT_Bin_Input={z_pT_Bin_Input})'")
        return "Error"
        